import React from "react";
import { Link } from "react-router-dom";

function Navigation({ navLinks }) {
  return (
    <nav>
      <Link to="/">
        <img src="logo.png" alt="Logo" />
      </Link>
      <div>
        {navLinks.map((item, index) => (
          <Link to="/" key={index}>
            <p>{item}</p>
          </Link>
        ))}
      </div>
    </nav>
  );
}

export default Navigation;
